import styled from "styled-components";

export const Container=styled.div`
margin-top: 250px;
border: 1px solid white;

`
export const Title=styled.div`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 48px;
line-height: 130%;
text-align: center;
color: rgba(255, 255, 255, 0.9);
`
export const Desc=styled.div`
width: 427px;
height: 60px;
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 18px;
line-height: 30px;
text-align: center;
color: rgba(255, 255, 255, 0.55);

`
